import React from "react";

const Card = (data) => {
    if (data[0]) {
        return (

            <div>
                <div>Place Name: {data[0].place_name}</div>
                <div>Reviewer: {data[0].reviewer}</div>
                <div>Review Date: {data[0].review_date}</div>
                <div>Review Comment: {data[0].review_comment}</div>
                <Card style={{ width: "22rem" }}>
                    <Card.Body>
                        <Card.Title style={{ color: "green" }}>GEEKSFORGEEKS</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">
                            One Stop For all CS subjects
          </Card.Subtitle>
                        <Card.Text>
                            GeeksforGeeks provides a platform for all the students to study
                            about all the subjects in CSE.
          </Card.Text>
                        <Card.Link href="#"> For Students</Card.Link>
                    </Card.Body>
                </Card>
            </div>

        );
    } else {
        return (
            <div />
        );
    }
};

export default Card;
